script: |
  super -f text -I q6058.spq | sort > q6058.out

inputs:
  - name: q6058.spq
    data: |
      SELECT DISTINCT * FROM tab0 (FORMAT parquet) WHERE + 97 NOT BETWEEN - col1 * - - col1 + - 0 - 47 AND 0 * col1;
  - name: tab0

outputs:
  - name: q6058.out
    data: |
      15	81	47
      87	21	10
      97	1	99
